INSERT INTO `tipo_articulo` (`ID`, `NOMBRE`, `DESCRIPCION`, `ACTIVO`, `CREADO_POR`, `CREADO_EL`, `ACTUALIZADO_POR`, `ACTUALIZADO_EL`) VALUES
(1,	'Terminado',	'artículos que se tienen en inventario y que se encuentran listos para ser embarcados a un cliente de acuerdo a un pedido en una planta de producción.',	'S',	'admin',	'2012-06-04 10:52:07',	'admin',	'2012-06-04 10:52:07'),
(2,	'Materia Prima',	'artículos esenciales que se utilizan para la elaboración de un producto, las materias primas son las que permiten iniciar el ciclo de transformación para obtener los componentes o el producto terminado que es ofrecido al cliente.',	'S',	'admin',	'2012-06-04 10:52:37',	'admin',	'2012-06-04 10:52:37'),
(3,	'Semielaborado',	'artículos que ingresan al inventario después de concluir varias etapas del proceso productivo, pero que aún no cumplen con todas las especificaciones que caracterizan al producto final que es ofrecido a los clientes. Los artículos semielaborados pueden considerarse como componentes de un artículos posterior, que se conforma a partir de ellos.',	'S',	'admin',	'2012-06-04 10:53:16',	'admin',	'2012-06-04 10:53:16'),
(4,	'Mat. Empaque',	'el material de empaque son productos utilizados para empacar el artículo terminado del proceso productivo. El material de empaque es el que evita que las condiciones del ambiente cambien las características originales del producto terminado.',	'S',	'admin',	'2012-06-04 10:53:47',	'admin',	'2012-06-04 10:53:47'),
(5,	'Proceso',	'productos que están siendo transformados por un proceso productivo en un lapso determinado.',	'S',	'admin',	'2012-06-04 10:54:05',	'admin',	'2012-06-04 10:54:05'),
(6,	'Reproceso',	'productos que han tenido que iniciar nuevamente todas o varias etapas del proceso productivo puesto que no cumplieron con las especificaciones de calidad para el mismo.',	'S',	'admin',	'2012-06-04 10:54:24',	'admin',	'2012-06-04 10:54:24'),
(7,	'Laboral',	'este tipo de artículo se utiliza para reflejar transacciones de inventario de tipo servicio, puesto que no acepta existencias en inventario.',	'S',	'admin',	'2012-06-04 10:54:43',	'admin',	'2012-06-04 10:54:43'),
(8,	'Otros',	'se utiliza cuando el artículo no coincide con ninguna de las categorías definidas en esta opción.',	'S',	'admin',	'2012-06-04 10:55:00',	'admin',	'2012-06-04 10:55:00'),
(9,	'Suministro',	'son artículos que se requieren para la realización del trabajo de la empresa, tales suministros no participan directamente en el proceso productivo pero permiten que éste se lleve a cabo.',	'S',	'admin',	'2012-06-04 10:55:23',	'admin',	'2012-06-04 10:55:23'),
(10,	'Refacción',	'artículos del inventario que sirven como repuestos o para reemplazo de piezas de la maquinaria o equipo utilizado en la empresa.',	'S',	'admin',	'2012-06-04 10:55:38',	'admin',	'2012-06-04 10:55:38'),
(11,	'Servicio',	'un artículo se define de este tipo cuando se refiere a un servicio que ofrece la empresa como parte de su labor diaria',	'S',	'admin',	'2012-06-04 10:55:56',	'admin',	'2012-06-04 10:55:56'),
(12,	'Co-producto',	'productos que son manufacturados juntos o secuencialmente, por sus similitudes de producto o proceso. Los co-productos son aquellos que parten de un mismo material inicial, pero que luego se van convirtiendo en productos finales con distintas características.',	'S',	'admin',	'2012-06-04 10:56:13',	'admin',	'2012-06-04 10:56:13'),
(13,	'Subproducto',	'material de desecho, producto del proceso de un artículo, que es usado para otros propósitos.',	'S',	'admin',	'2012-06-04 10:56:34',	'admin',	'2012-06-04 10:56:34'),
(14,	'Desecho',	'productos que son eliminados del proceso productivo por incumplimiento con las especificaciones, pero que no puede corregir el error, de manera que es imposible reprocesarlo.',	'S',	'admin',	'2012-06-04 10:56:50',	'admin',	'2012-06-04 10:56:50'),
(15,	'Fantasma',	'se refiere a artículos que no existen en la bodega como tales, pero que se definen como parte de una estructura de manufactura, es decir, es un artículo intermedio entre la materia prima y el producto terminado.',	'S',	'admin',	'2012-06-04 10:57:09',	'admin',	'2012-06-04 10:57:09'),
(16,	'Kit',	'un artículo tipo kit es aquel que está conformado por varios artículos terminados que se venden en un solo paquete.',	'S',	'admin',	'2012-06-04 10:57:27',	'admin',	'2012-06-04 10:57:27');
